r($,"axW","ez",()=>A.a([A.vm("Menurut teori Holland, seseorang yang memiliki kepribadian realistis dianggap lebih suka bekerja secara manual dan menikmati pengoperasian perangkat (mesin) atau kendaraan. \n\nBanyak profesi pekerjaan yang realistis melibatkan aktivitas di luar ruangan, bekerja dengan hewan, dan mengharuskan seseorang untuk mengotori tangan mereka ketika bekerja. \n\nProfesi yang cocok untuk kepribadian realistis ini berbanding terbalik dengan pekerjaan kantor, di mana orang-orang cenderung duduk di dalam ruangan sepanjang hari.Terlebih lagi, menurut teori RIASEC, seseorang dengan kepribadian realistis cenderung memiliki hobi seperti berkebun, memelihara hewan peliharaan, mengotak-atik mobil, dan olahraga di luar ruangan.","assets/lottie/engineer.json","Realistic",0),A.vm("Holland percaya bahwa orang dengan kepribadian investigatif memiliki rasa ingin tahu yang kuat, suka belajar, dan analitis.Profesi yang bersifat investigatif mengharuskan seseorang untuk menganalisis tugas dengan sangat hati-hati.\n\nHobi dari orang-orang yang berkepribadian investigative, di antaranya bermain sudoku, catur, hingga belajar bahasa asing.Jenis profesi yang cocok untuk kepribadian investigatif dapat ditemukan di dalam dunia pendidikan, perawatan kesehatan, perusahaan inovatif, hingga teknologi informasi.","assets/lottie/medicine.json","Investigative",0),A.vm("Seseorang yang mendapatkan jenis kepribadian artistik di akhir RIASEC test cenderung kreatif dan bersifat otentik. Profesi artistik umumnya melibatkan desain dan ekspresi.\n\nBerbagai pekerjaan artistik mengharuskan seseorang untuk melihat dunia dari perspektif baru yang unik, entah itu melalui gambar, bahasa, atau ide-idenya tersendiri. \n\nHobi seseorang dengan kepribadian artistik termasuk melukis, fotografi, menulis, memasak, membuat kerajinan, desain, hingga mengunjungi museum.\n\nSeseorang dengan jenis kepribadian artistik dapat menemukan banyak profesi di bidang periklanan, industri musik, teater, hingga perusahaan desain.","assets/lottie/photography.json","Artistic",0),A.vm("Jika kamu mendapatkan kepribadian sosial setelah mengikuti tes Holland, itu dapat menandakan bahwa kamu senang membantu atau mengajari orang lain.\n\nProfesi yang cocok untuk jenis kepribadian RIASEC ini umumnya mengharuskan seseorang untuk bekerja sama secara intens dengan orang lain atau mempelajari informasi baru bersama-sama.\n\nOrang-orang berkepribadian sosial umumnya memiliki hobi, seperti berolahraga dalam tim, menjadi sukarelawan, hingga senang makan di luar bersama teman atau keluarga.\n\nProfesi yang cocok untuk kepribadian sosial dapat ditemukan di dalam pemerintahan, pendidikan, perawatan kesehatan, hingga pelayanan sosial.","assets/lottie/real.json","Social",0),A.vm("Orang yang giat, suka mengambil inisiatif, berani mengambil risiko, atau memiliki kepemimpinan yang baik adalah karakteristik dari jenis kepribadian enterprising. \n\nProfesi yang cocok untuk kepribadian enterprising umumnya mengharuskan seseorang untuk mengambil banyak keputusan penting, mengarahkan atau meyakinkan orang lain, hingga bertanggung jawab atas tugas-tugas yang ada. \n\nOrang dengan kepribadian enterprising cenderung memiliki hobi, seperti investasi, pelatihan dan pembinaan di klub olahraga, hingga berkutat di dalam dunia politik.\n\nPekerjaan yang cocok untuk kepribadian enterprising dapat ditemukan di dalam dunia manajemen, pemasaran, perdagangan, administrasi, dan politik.","assets/lottie/marketing.json","Enterprising",0),A.vm("Orang dengan kepribadian konvensional cenderung bersifat perfeksionis dan lebih suka bekerja secara terstruktur serta sesuai dengan kesepakatan yang telah ditetapkan. \nProfesi yang cocok untuk kepribadian konvensional umumnya mengharuskan pekerjaan dilakukan sesuai dengan pola atau peraturan yang ditetapkan. Pekerjaan ini cenderung bersifat rutin atau berbasis proses.\n\nOrang-orang dengan kepribadian konvensional dianggap lebih menyukai hobi yang melibatkan pengumpulan barang atau meneliti silsilah keluarga.\n\nProfesi yang cocok untuk kepribadian konvensional dapat ditemukan di dalam dunia perbankan, perusahaan yang terlibat dalam pengelolaan dan pemeliharaan properti, perusahaan administrasi, sektor keuangan, hingga organisasi pemerintah.","assets/lottie/accounting.json","Conventional",0)],A.Y("p<ky>")))
